import React, { useState, useEffect } from 'react';
import { useNavigate, useParams } from 'react-router-dom';

// Datos simulados (normalmente vendrían de una API o contexto global)
const talleresMock = [
  {
    id: 1,
    nombre: "Cocina Italiana",
    descripcion: "Aprende las técnicas tradicionales de la cocina italiana.",
    cuposDisponibles: 5,
    cuposTotales: 15
  },
  {
    id: 2,
    nombre: "Repostería Francesa",
    descripcion: "Domina los clásicos de la pastelería francesa.",
    cuposDisponibles: 2,
    cuposTotales: 10
  },
  {
    id: 3,
    nombre: "Cocina Asiática",
    descripcion: "Técnicas auténticas de cocina tailandesa y japonesa.",
    cuposDisponibles: 8,
    cuposTotales: 12
  }
];

const ReservarTaller = () => {
  const navigate = useNavigate();
  const { id } = useParams(); // <---- Obtenemos el ID desde la URL
  const [taller, setTaller] = useState(null);
  const [reservado, setReservado] = useState(false);
  const [yaReservado, setYaReservado] = useState(false);
  const [cargando, setCargando] = useState(false);

  useEffect(() => {
    const tallerEncontrado = talleresMock.find(t => t.id === parseInt(id));
    if (tallerEncontrado) {
      setTaller(tallerEncontrado);
    } else {
      // Si no se encuentra, redirigimos
      navigate('/navegar');
    }
  }, [id, navigate]);

  useEffect(() => {
    // Simular verificación de reserva previa
    if (taller) {
      setTimeout(() => {
        setYaReservado(false); // Simulación: cambia a true si ya está reservado
      }, 500);
    }
  }, [taller]);

  const handleReservar = () => {
    setCargando(true);
    setTimeout(() => {
      setReservado(true);
      setTaller(prev => ({
        ...prev,
        cuposDisponibles: prev.cuposDisponibles - 1
      }));
      setCargando(false);
    }, 1000);
  };

  if (!taller) return <div style={{ padding: 40 }}>Cargando taller...</div>;


  return (
    <div style={styles.mainContainer}>
      {/* Menú de navegación */}
      <nav style={styles.nav}>
        <button 
          style={styles.navButton}
          onClick={() => handleNavigation('/navegar')}
          onMouseEnter={(e) => {
            e.target.style.backgroundColor = '#FFF3E2';
            e.target.style.color = '#D94F4F';
          }}
          onMouseLeave={(e) => {
            e.target.style.backgroundColor = 'transparent';
            e.target.style.color = '#FFF3E2';
          }}
        >
          Talleres
        </button>
        <button 
          style={styles.navButton}
          onClick={() => handleNavigation('/reservartaller')}
          onMouseEnter={(e) => {
            e.target.style.backgroundColor = '#FFF3E2';
            e.target.style.color = '#D94F4F';
          }}
          onMouseLeave={(e) => {
            e.target.style.backgroundColor = 'transparent';
            e.target.style.color = '#FFF3E2';
          }}
        >
          Reservar
        </button>
        <button 
          style={styles.navButton}
          onClick={() => handleNavigation('/verreservas')}
          onMouseEnter={(e) => {
            e.target.style.backgroundColor = '#FFF3E2';
            e.target.style.color = '#D94F4F';
          }}
          onMouseLeave={(e) => {
            e.target.style.backgroundColor = 'transparent';
            e.target.style.color = '#FFF3E2';
          }}
        >
          Mis Reservas
        </button>
        <button 
          style={styles.navButton}
          onClick={() => handleNavigation('/perfil')}
          onMouseEnter={(e) => {
            e.target.style.backgroundColor = '#FFF3E2';
            e.target.style.color = '#D94F4F';
          }}
          onMouseLeave={(e) => {
            e.target.style.backgroundColor = 'transparent';
            e.target.style.color = '#FFF3E2';
          }}
        >
          Perfil
        </button>
        <button 
          style={styles.navButton}
          onClick={() => handleNavigation('/')}
          onMouseEnter={(e) => e.target.style.backgroundColor = '#FAFAFA'}
          onMouseLeave={(e) => e.target.style.backgroundColor = 'transparent'}
        >
          Cerrar Sesión
        </button>
      </nav>

      {/* Contenido centrado */}
      <div style={styles.contentContainer}>
        <div style={styles.card}>
          <div style={styles.header}>
            <h1 style={{ margin: 0, fontSize: '24px', fontWeight: 'bold' }}>
              RESERVAR TALLER
            </h1>
          </div>
          
          <div style={styles.content}>
            {/* Mensajes de estado */}
            {reservado && (
              <div style={styles.successMessage}>
                ¡Reserva confirmada correctamente!
              </div>
            )}
            
            {yaReservado && (
              <div style={styles.errorMessage}>
                Ya tienes una reserva para este taller.
              </div>
            )}
            
            {taller.cuposDisponibles <= 0 && !reservado && (
              <div style={styles.errorMessage}>
                No hay cupos disponibles para este taller.
              </div>
            )}
            
            <div style={styles.cuposInfo}>
              Cupos disponibles: {taller.cuposDisponibles}/{taller.cuposTotales}
            </div>

            <div style={styles.tallerInfo}>
              <h2 style={styles.tallerTitle}>
                {taller.nombre}
              </h2>
              <p style={styles.tallerDesc}>
                {taller.descripcion}
              </p>
            </div>
            
            {!reservado && !yaReservado && taller.cuposDisponibles > 0 && (
              <button
                style={{
                  ...styles.button,
                  ...(cargando && styles.buttonDisabled)
                }}
                onClick={handleReservar}
                disabled={cargando}
                onMouseEnter={(e) => !cargando && (e.target.style.backgroundColor = '#5A7A1D')}
                onMouseLeave={(e) => !cargando && (e.target.style.backgroundColor = '#6B8E23')}
              >
                {cargando ? 'Procesando...' : 'Confirmar Reserva'}
              </button>
            )}
            
            {reservado && (
              <button
                style={styles.button}
                onClick={() => navigate('/mis-reservas')}
                onMouseEnter={(e) => e.target.style.backgroundColor = '#5A7A1D'}
                onMouseLeave={(e) => e.target.style.backgroundColor = '#6B8E23'}
              >
                Ver mis reservas
              </button>
            )}
          </div>
        </div>
      </div>
    </div>
  );
};

export default ReservarTaller;
